        internal void League()
        {
            DataTable table = CSV.Tables.Get(Gamefile.Leagues);
            int i = 0;
            b++;
            bool found = false;
            while (!found)
            {
                var league = (Leagues)table.Datas[i];
                if (b <= league.BucketPlacementRangeHigh[league.BucketPlacementRangeHigh.Length - 1] && b >= league.BucketPlacementRangeLow[0])
                {
                    found = true;
                }
                i++;
            }
        }

        internal void Uncompress(string Hexa)
        {
            Reader br = new Reader(Hexa.HexaToBytes());

            var data = br.ReadFully();
            Console.WriteLine(BitConverter.ToString(data).Replace("-", ""));
            Console.WriteLine(Encoding.UTF8.GetString(data));
        }

